<body>
    
    
    <style>
        .folium-map {
            width: 100%;
            height: 100%;
        }
        .time-label {
            position: absolute;
        }
        #calculate-btn {
            position: absolute;
            top: 10px;
            left: 10px;
            z-index: 1000;
            background-color: white;
            padding: 10px;
            border: 1px solid black;
            cursor: pointer;
        }
    </style>
    <div id="calculate-btn">Calculate Distribution</div>
    <script>
        document.addEventListener('DOMContentLoaded', function () {
            console.log('Map loaded');
            var map = L.map('map_c91a4fa3c100153dafa94967728dd363').setView([31.42501215559877, 34.428270133276435], 10);
            L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            }).addTo(map);

            var drawnLayer;

            map.on('draw:created', function (e) {
                if (drawnLayer) {
                    map.removeLayer(drawnLayer);
                }
                drawnLayer = e.layer;
                map.addLayer(drawnLayer);
                console.log('Polygon drawn:', drawnLayer.toGeoJSON().geometry.coordinates);
            });

            document.getElementById('calculate-btn').addEventListener('click', function() {
                if (!drawnLayer) {
                    alert("Please draw a polygon first.");
                    return;
                }

                var typesCount = { 'UAV': 0, 'HELI': 0, 'JET': 0 };
                document.querySelectorAll('.leaflet-marker-pane .time-label').forEach(function(label) {
                    var marker = label.closest('.leaflet-marker-icon');
                    var latLng = marker._latlng;
                    if (drawnLayer.getBounds().contains(latLng)) {
                        var type = label.getAttribute('data-type');
                        if (type in typesCount) {
                            typesCount[type]++;
                        }
                    }
                });

                console.log('Types Count:', typesCount);
                alert(`
                    Distribution of Types within Polygon:
                    UAV: ${typesCount['UAV']}
                    HELI: ${typesCount['HELI']}
                    JET: ${typesCount['JET']}
                `);
            });
        });
    </script>
